import "./TopBar.css";

export default function TopBarButtons() {
  return (
    <div className="Nav">
      <a href="index.html" id="Logo">
        Logo
      </a>
      <div id="NavMiddle">
        <a href="" id="BlogBtn">Blog</a>
        <a id="Home" href="index.html">
          Home
        </a>
        <a href="" id="Projects">Projects</a>
      </div>
      <a href="socials.html" id="Socials">
        Socials
      </a>
    </div>
  );
}
